import React, { useEffect,useState } from 'react';

const SkillsForm = () => {
    const [ skills, setSkills ] = useState([])

    const getAllSkills = (data) => {
        //console.log(data)
        fetch('https://emsiservices.com/skills/versions/latest/skills',{ method:"GET", headers: {'Authorization': `Bearer ${data}`} })
        .then(response => {
            if (!response.ok){
                throw new Error(`An error occured with status code: ${response.status}`)
            }
            return response.json()
        })
        .then(data => {
            const extractedData = data['data'].map(({ id, name }) => ({ id, name }));
            setSkills(extractedData);
        })
        .catch(error => console.log(error))
    }

    useEffect(() => {
        fetch('http://127.0.0.1:8000/apis/access_token/')
        .then(response => {
            if (!response.ok){
                throw new Error(`HTTP Error, status code: ${response.status}`)
            }
            return response.json()
        })
        .then(data => {getAllSkills(data.message) })
        .catch(error => {
            console.log(error)
        })
    },[])

    return(
        <div><h1>This is the Skills Form page</h1></div>
    )
}

export default SkillsForm;
